import React from "react";
import { Link } from "react-router-dom";
import "./navbar.css";
import { useState } from "react";
import SignUp from "./signupPage.js";

const Navbar = () => {
  const [openPopup, isOpen] = useState(false);
  return (
    <div>
      <nav className="header">
        <ul className="nav-left">
          <li>
            <Link to="/">
              <img src="/eventlylogo.svg" alt="evently logo" />
            </Link>
          </li>
          <li>
            <Link to="/home">Evently</Link>
          </li>
        </ul>
        <ul className="nav-right">
          <li>
            <Link to="/loginPage">Log In</Link>
          </li>
          <li>
            <Link onClick={() => isOpen(true)} to="/signupPage">
              Sign Up
            </Link>
            <SignUp trigger={openPopup}></SignUp>
          </li>
          <li>
            <Link to="/profile">
              <img src="/profilelogo.svg" alt="profile" />
            </Link>
          </li>
        </ul>
      </nav>
      <div>{/* <LogIn trigger={buttonPopup}></LogIn> */}</div>
    </div>
  );
};
export default Navbar;
